/* NSPAY2 CONSTANTS FOR SHARED USAGE */

// Roles
export const NSPAY2_ROLES = {
  MINDEF_MANAGEMENT: 'role-mm',
  MINDEF_APPROVER: 'role-ma',
  MINDEF_VERIFIER: 'role-mv',
  MINDEF_CSO: 'role-cso',
  CLAIMS_APPROVER: 'role-ca',
  CLAIMS_VERIFIER: 'role-cv',
  PAYROLL_APPROVER: 'role-pa',
  PAYROLL_VERIFIER: 'role-pv',
  ADMIN_APPROVER: 'role-aa',
  ADMIN_VERIFIER: 'role-av',
  APPLICATION_SUPPORT: 'role-as',
  REPORT_VIEWER_GENERAL: 'role-rvg',
  REPORT_VIEWER_CLASSIFIED: 'role-rvc',
  INTERGRATED_CASE_MANAGER: 'role-icm',
  ACCOUNT_REVIEW_VERIFIER: 'role-arv',
  ACCOUNT_REVIEW_SUPERVISOR: 'role-ars',
  ACCOUNT_REVIEW_APPROVER: 'role-ara',
};

// Groups
export const NSPAY2_GROUPS = {
  U1: 'U1',
  U2: 'U2',
  U3: 'U3',
  U4: 'U4',
  U5: 'U5',
  U6: 'U6'
};

export const NSPAY2_STATUS = {
  PENDING_FIRST_VERIFICATION: 'PENDING_FIRST_VERIFICATION',
  PENDING_SECOND_VERIFICATION: 'PENDING_SECOND_VERIFICATION',
  APPROVED: 'APPROVED',
  PENDING_APPROVAL: 'PENDING_APPROVAL'
};

export const NSPAY2_REQUESTTYPE = {
  CREATE: 'CREATE',
  EDIT: 'EDIT',
  DELETE: 'DELETE'
};

export const NSPAY2_REFTYPE = {
  ATTENDANCE: 'ATTENDANCE',
  ALLOWANCE: 'ALLOWANCES',
  AWARD: 'AWARDS'
};

export const NSPAY2_REFCODE = {
  X3: 'X3',
  X4: 'X4',
  X1: 'X1',
  OTHER: '12'
};

export const NSPAY2_ACCESS_STATUS = [
  {
    code:'A',
    desc:'Active'
  },
  {
    code:'D',
    desc:'Disabled'
  }
]

export const NSPAY2_STATION = {
  STATION_VERIFICATION:"V",
  STATION_CERTIFICATION:"C",
  STATION_APPROVAL:"A",
  STATION_SERB:"S",
  STATION_2ND_APPROVAL:"B"
}
